import React from "react";
import DriveVideoEmbed from "./DriveVideoEmbed.jsx";

function VideoSlider({ videoList }) {
    return (
        <>
            {videoList.map((video, index) => (
                <DriveVideoEmbed
                    key={index} // Add a key to uniquely identify each video
                    videoUrl={video.videoUrl} // Access videoUrl from the object
                    vertical={video.vertical} // Access vertical from the object
                />
            ))}
        </>
    );
}

export default VideoSlider;
